import './App.css';
import React, { Component } from 'react'
import Navbar from './components/Navbar';
import News from './components/News';
import {
  BrowserRouter as Router,
  Routes,
  Route
} from "react-router-dom";

export class App extends Component {

  apiKey = "";
  render() {
    return (
      <>
      <Router>
      <div>
        <Navbar />
        <Routes>
          <Route exact path="/" element={<News apikey ="general" pagesize={6} country="in" category= "general"/>} />
          <Route exact path="/sports" element={<News apikey ="sports" pagesize={6} country="in" category= "sports"/>} />
          <Route exact path="/business" element={<News apikey ="business" pagesize={6} country="in" category= "business"/>} />
          <Route exact path="/entertainment" element={<News apikey ="entertainment" pagesize={6} country="in" category= "entertainment"/>} />
          <Route exact path="/health" element={<News apikey ="health" pagesize={6} country="in" category= "health"/>} />
          <Route exact path="/technology" element={<News apikey ="technology" pagesize={6} country="in" category= "technology"/>} />
          <Route exact path="/science" element={<News apikey ="science" pagesize={6} country="in" category= "science"/>} />
        </Routes>
      </div>
      </Router>
      </>
    )
  }
}

export default App;
